import keyMirror from 'keymirror';

export const states = keyMirror({
    WELCOME: true,
    PERSON_CHOOSE: true,
    CAR_DETAIL: true,
    DRIVER_START: true,
    RIDER_START: true,
    DRIVER_FINISH: true,
    RIDER_FINISH: true,
    CONFIRM: true
});
